import React from 'react';
import { CanvasContext } from '@bucky24/react-canvas';

const MyElement = (props) => {
    return <CanvasContext.Consumer>
        {({ context }) => {
            if (!context) {
                return null;
            }
            context.save();

            // do context things here

            context.restore();
        }}
    </CanvasContext.Consumer>
}

export default MyElement;
